import React from "react";
import Button from "./Button";
import styles from "./App.module.css";

class App extends React.Component {
  state = {
    isLoading: true,
    movieImgs: [],
  };
  //img data fetch
  getMovieImgs = async () => {
    const res = await axios.get("./data/dummy.json");
    // const data = await res.json();
    console.log(res);
  };

  componentDidMount() {
    this.getMovieImgs();
  }
  render() {
    const { isLoading } = this.state;
    return (
      <div>
        <h1 className="title">{isLoading}</h1>
        <Button text={"click"} />
      </div>
    );
  }
}

export default App;
